CompositorFrameSinkAsyncWaiter::CompositorFrameSinkAsyncWaiter(CompositorFrameSink* proxy)
    : proxy_(proxy)
{
}

CompositorFrameSinkAsyncWaiter::~CompositorFrameSinkAsyncWaiter() = default;

void CompositorFrameSinkAsyncWaiter::SubmitCompositorFrameSync(const ::viz::LocalSurfaceId& local_surface_id, ::viz::CompositorFrame frame,
    std::optional<::viz::HitTestRegionList> hit_test_region_list, uint64_t submit_time, std::vector<::viz::ReturnedResource>* out_resources)
{
    base::RunLoop loop;
    proxy_->SubmitCompositorFrameSync(std::move(local_surface_id), std::move(frame), std::move(hit_test_region_list), std::move(submit_time),
        base::BindOnce(
            [](base::RunLoop* loop, std::vector<::viz::ReturnedResource>* out_resources, std::vector<::viz::ReturnedResource> resources) {
                *out_resources = std::move(resources);
                loop->Quit();
            },
            &loop, out_resources));
    loop.Run();
}

std::vector<::viz::ReturnedResource> CompositorFrameSinkAsyncWaiter::SubmitCompositorFrameSync(const ::viz::LocalSurfaceId& local_surface_id,
    ::viz::CompositorFrame frame, std::optional<::viz::HitTestRegionList> hit_test_region_list, uint64_t submit_time)
{
    std::vector<::viz::ReturnedResource> async_wait_result;
    SubmitCompositorFrameSync(std::move(local_surface_id), std::move(frame), std::move(hit_test_region_list), std::move(submit_time), &async_wait_result);
    return async_wait_result;
}

